<script setup>
const props = defineProps({
  // eslint-disable-next-line vue/require-prop-types
  editorModel: {
    headWear: '',
    headWearColor: '',
    neckWear: '',
    neckWearColor: '',
    accessory: () => [],
    accessoryColor: '',
  },
})

let headWearEl
let neckWearEl
let accessoryEls = []

onMounted(() => {
  headWearEl = document.getElementById('headwear')
  neckWearEl = document.getElementById('neckwear')
  accessoryEls = useAttrs().accessories.map(accessory => document.getElementById(accessory))

  refresh(props.editorModel)
})

const refresh = (val) => {
  Array.from(headWearEl.children).forEach((v) => {
    v.style.display = v.id === useKebabCase(val.headWear) ? 'block' : 'none'
  })

  Array.from(neckWearEl.children).forEach((v) => {
    v.style.display = v.id === useKebabCase(val.neckWear) ? 'block' : 'none'
  })

  accessoryEls.forEach((v) => {
    v.style.display = val.accessory.includes(v.id) ? 'block' : 'none'
  })
}

watch(
  props.editorModel,
  (newVal) => {
    refresh(newVal)
  }
)

const cssVars = computed(() => {
  return {
    '--headwearColor': props.editorModel.headWearColor,
    '--neckwearColor': props.editorModel.neckWearColor,
    '--accessoryColor': props.editorModel.accessoryColor,
  }
})
</script>

